Q:

How to group by in sql server where value is same

I have below table  
POCNO  | Location | CommitDate
1      |  A       | 01-01-2019
1      |  B       | 01-02-2019
1      |  B       | 01-03-2019
1      |  A       | 01-04-2019
2      |  A       | 01-01-2019

I need output as below
POCNO  | Location | CommitDate | NumberOfCommits
1      |  A       | 01-01-2019 | 1
1      |  B       | 01-03-2019| 1
1      |  A       | 01-04-2019| 1
2      |  A       | 01-01-2019| 1

How can I achieve this using sql server?

A:

You can use row_number():
select t.*
from (select t.*,
             row_number() over (partition by POCNO order by CommitDate) as seqnum
      from t
     ) t
where seqnum = 1;

Q:

Javascript not executing when loading from remote server

I've got a rather odd problem. I have a fairly simple script that I use to insert a photo in an email template. 
var img = document.createElement('img');
img.src = 'https://www.example.com/image.jpg';
img.onload = function() {
    console.log('Image loaded!');
}

document.body.appendChild(img);

This code works great when I run it in my local environment. When I deploy to a remote server, however, the image isn't inserted into the template. I've tried using a different server as well but I still get the same result.
Is there any reason why this code would not be executing when it is loaded from a remote server?

A:

Make sure the headers are set correctly for CORS
